import React from "react";
import {Route, Redirect} from "react-router-dom";



class ProtectedRoute extends React.Component{
    render(){
      return (
        <Route
          {...rest}
          render={props => {
            if (localStorage.getItem('userData')) {
              return <div className="container mt-5">
              <div className="row">
                <div className="col-lg-1">
                <img src={"https://avatars.dicebear.com/api/avataaars/"+JSON.parse(localStorage.getItem('userData'))['name']+".svg"} alt="avatar" className="rounded-circle img-fluid" width="75" height="75"/>
                </div>
                <div className="col-lg-6">
                <p className="text-muted display-4">{JSON.parse(localStorage.getItem('userData'))['name']}</p>
                </div>
              </div>


              <p className="text-muted">{JSON.parse(localStorage.getItem('userData'))['uemail']}</p>
              <p className="text-muted">Last updated on :{Date(JSON.parse(localStorage.getItem('userData'))['lastupdated'])}</p>

              <button className="btn btn-danger"
          onClick={() => {
            localStorage.clear();
            props.history.push('/login');
            window.location.reload(false);
          }}
        >
          Logout
        </button>
          <button className="btn btn-primary ml-4">Edit Profile</button>
          <br/>
          <h1 className="display-6 mt-4">Your Posts</h1>
          <div className="row">
            <div className="col-lg-12">

                <div className="row">
                  <div className="col-lg-12">
                    <div className="card mb-4">
                      <div className="card-body">
                      <div className="card-title">
                        <h1>Card Title</h1>
                        <p className="text-muted">Lorem ipsum dolor sit amet consectetur adipisicing elit. Ad atque sit, maiores reprehenderit error cum fuga ipsum consequatur? Officia veritatis reiciendis natus quae, excepturi fugiat id. Debitis amet enim rem!</p>
                      </div>
                      </div>

                    </div>
                  </div>

              </div>
              <div className="row">
                  <div className="col-lg-12">
                    <div className="card">
                      <div className="card-body">
                      <div className="card-title">
                        <h1>Card Title</h1>
                        <p className="text-muted">Lorem ipsum dolor sit amet consectetur adipisicing elit. Ad atque sit, maiores reprehenderit error cum fuga ipsum consequatur? Officia veritatis reiciendis natus quae, excepturi fugiat id. Debitis amet enim rem!</p>
                      </div>
                      </div>

                    </div>
                  </div>

              </div>
            </div>
          </div>
        </div>;
            } else {
              return (
                <Redirect
                  to={{
                    pathname: "/login",
                    state: {
                      from: props.location
                    }
                  }}
                />
              );
            }
          }}
        />

      );
    }

  }


export default ProtectedRoute;
